extern inline
void free_image(Image *img) {
    free(img->pixels);
    free(img);
}

/// Print an image into stdout.
void print_image(Image *img){
    for (int y = 0; y < img->height; ++y){
        for (int x = 0; x < img->width; ++x){
            unsigned val = img->pixels[x + y * img->width];
            printf("%c ", val ? '#' : '.');
        }
        printf("\n");
    }
    printf("\n");
}

/// Clones a subimage of `src` into a new image using the provided rectangle verticies.
Image *subimage(Image *src, Rect bounds) {
    Image *img = malloc(sizeof(Image));
    img->width = (bounds.right - bounds.left) + 1;
    img->height = (bounds.bottom - bounds.top) + 1;
    unsigned *pixels = calloc(img->width*img->height, sizeof(unsigned));
    img->pixels = pixels;

    // Copy row by row from the source into the subimage
    for (int y = 0; y < img->height; ++y){
        size_t row_start = (bounds.top * src->width + bounds.left) + y*src->width;
        memcpy(&pixels[y*img->width], &src->pixels[row_start], img->width * sizeof(unsigned));
    }

    return img;
}

/// Trims off trailing garbage to the left and right on a binary image
Image *trim_garbage(Image *img){
    // Cut garbage from left
    int l = 0, r = img->width-1, t = 0, b = img->height-1;
    for (int i = 0; i < img->width; ++i) {
        unsigned count = 0;
        for (int j = 0; j < img->height; ++j){
            count += img->pixels[j*img->width + i];
        }
        unsigned thresh = (unsigned)round((double)(img->height)/(double)(SCALE_H));
        if (count <= thresh && (!i || l == i-1)) { l = i; }
        else { break; }
    }

    // Cut from right
    for (int i = img->width-1; i > 0; --i) {
        unsigned count = 0;
        for (int j = 0; j < img->height; ++j){
            count += img->pixels[j*img->width + i];
        }
        unsigned thresh = (unsigned)round((double)(img->height)/(double)(SCALE_H));
        if (count <= thresh && (r == i+1)) { r = i; }
        else { break; }
    }
    // Return new image using new bounds
    Rect bounds = { .top=t, .left=l, .bottom=b, .right=r }; 
    return subimage(img, bounds);
}

/// Rescales image to SCALE_W x SCALE_H using average value sampling
Image *resized_image(Image *src_img){
    const int W = SCALE_W, H = SCALE_H;
    double x_scale = (double)(src_img->width)/W;
    double y_scale = (double)(src_img->height)/H;
    
    int x_wdw = (int)(floor(x_scale));
    int y_wdw = (int)(floor(x_scale));
    
    if (x_wdw < 1)  { x_wdw = 1; }
    if (y_wdw < 1)  { y_wdw = 1; }
    

    unsigned *dest = calloc(W * H, sizeof(unsigned));
    unsigned *src = src_img->pixels;
    Image *dest_img = malloc(sizeof(Image));
    dest_img->width = W;
    dest_img->height = H;
    dest_img->pixels = dest;

    for (int y = 0; y < H; ++y){
        for (int x = 0; x < W; ++x){
            double n = 0;
            double sample = 0;
            for (int wy = 0; wy < y_wdw; ++wy){
                for (int wx = 0; wx < x_wdw; ++wx){
                    int x_scaled = (int)round((double)(x)*x_scale);
                    int y_scaled = (int)round((double)(y)*y_scale);

                    int smpl_x = x_scaled + wx, smpl_y = y_scaled + wy;
                    if (smpl_x >= src_img->width || smpl_y >= src_img->height) continue;
                    sample += (double)(src[smpl_x + smpl_y*src_img->width]);
                    n++;
                }
            }
            sample/=n;
            dest[x + y*dest_img->width] = (unsigned)(round(sample));
        }
    }
    return dest_img;
}

/// Create a truth table using binary data from `og_truths`
void populate_truths() {
    for (size_t i = 0; i < 10; ++i){
        Image img = (Image){.width=31, .height=48, .pixels=og_truth[i]};
        Image *ds = resized_image(&img);
        memset(truth[i], 0, sizeof(unsigned) * SCALED_N);
        memmove(truth[i], ds->pixels, sizeof(unsigned) * SCALED_N);
        free_image(ds);
    }
}

/// Calculate distance between two matrices as mean squared error
double matrix_distance(unsigned a[SCALED_N], unsigned b[SCALED_N]){
    double sq_err = 0; 

    for (size_t i = 0; i < SCALED_N; ++i){
        double x = (double)(a[i]), y = (double)(b[i]);
        double c = (x-y)*(x-y);
        sq_err += (c-sq_err)/(i+1);
    }
    return sq_err;

}

/// Mutates original image to use binary values
/// Returns the bounding rect containing all 1's in image.
Rect into_binary(Image *img) {
    const size_t N_PIXELS = img->width * img->height;
    // Find the color range 
    unsigned darkest = IMAGE_MAX, brightest = 0;
    for (size_t i = 0; i < N_PIXELS; ++i) {
        darkest = img->pixels[i] < darkest ? img->pixels[i] : darkest;
        brightest = img->pixels[i] > brightest ? img->pixels[i] : brightest;
    }
    unsigned range = brightest-darkest;

    
    // Apply contrasting (lowered for lower color ranges)
    double modifier = range + 35 < 255 ? 35.0 : 0.0;
    double C = 64.0 * (((double)(range) + modifier)/255.0);
    const double FACTOR = (259.0*(255.0+C))/(255.0*(259.0-C));
    darkest = IMAGE_MAX, brightest = 0;
    for (size_t i = 0; i < N_PIXELS; ++i) {
        double p = round(FACTOR * ((double)(img->pixels[i])-128.0) + 128.0);
        if (p < 0.0) { p = 0.0; } else if (p > 255.0) {p = 255.0;}
        img->pixels[i] = (unsigned) p;
        darkest = img->pixels[i] < darkest ? img->pixels[i] : darkest;
    }
    unsigned threshhold = darkest + TOLERANCE;

    // Apply threshholding and find bounding box
    unsigned left = img->width, top = img->height;
    unsigned right = 0, bottom = 0;
    for (size_t i = 0; i < N_PIXELS; ++i){
        if (img->pixels[i] <= threshhold) {
            // Calc coords of i
            unsigned x = i % img->width;
            unsigned y = i / img->width;

            // Top is calculated as the min of top and i
            left = x < left ? x : left;
            top = y < top ? y : top;

            // Bottom is calculated as the max of bot and i
            right = x > right ? x : right;
            bottom = y > bottom ? y : bottom;

            img->pixels[i] = 1;
        }
        else {
            img->pixels[i] = 0;
        }
    } 
    return (Rect){.top=top, .left=left, .bottom=bottom, .right=right};
}

/// Set cell as visited and pushes to queue. Returns value of cell.
extern inline 
size_t visit_cell(size_t id, size_t *queue, size_t *queue_len, char *visited, Image *img){
    visited[id] = 1;
    if (img->pixels[id]) {
        queue[(*queue_len)++] = id;
    }

    return img->pixels[id] ? 1 : 0;
}

/// Use cellular automata flood fill to detect and crop the first number on the right out of
/// an image. This proccess requires the numbers to have no gaps within a number.
/// Mutates the original image by cropping the number's subregion out.
/// The original image will not occupy less memory, however, the bytes will
/// shifted left, allowing for faster memory access.
Image *cut_rightmost_number(Image *img){
    const size_t N_PIXELS = img->width * img->height;
    char *visited = calloc(N_PIXELS, sizeof(char));
    size_t *queue = calloc(N_PIXELS, sizeof(size_t));
    size_t queue_len = 0;

    // Start in the middle-right
    size_t id = img->width * ((img->height+1)/2) - 1;
    while (1){
        if (img->pixels[id]) {
            queue[queue_len++] = id;
            break;
        }

        // Scan leftwards
        --id;
        // If we didn't hit anything in a row scan, we're done.
        if (id % img->width == 0) {
            return NULL;
        }
    }

    size_t seed = queue[0];
    size_t r = (seed % img->width), l = (seed % img->width);
    size_t t = (seed / img->width), b = (seed / img->width);

    // Progress through the queue, adding unvisited filled (val > 0) moore neighbours,
    // until there are no neighbours left to check. ( flood fill )
    while (queue_len) {
        // Calculate id values
        size_t id, id_x, id_y;
        id = queue[--queue_len]; 
        id_x = id % img->width; id_y = id / img->width;
        // Up
        if (id_y > 0 && !visited[id - img->width]){
            size_t visit_id = id - img->width;
            if (visit_cell(visit_id, queue, &queue_len, visited, img)){
                size_t visit_y = visit_id / img->width;
                t = visit_y < t ? visit_y : t;
            }
        }
        // Down
        if (id_y < (img->height-1) && !visited[id + img->width]){
            size_t visit_id = id + img->width;
            if (visit_cell(visit_id, queue, &queue_len, visited, img)){
                size_t visit_y = visit_id / img->width;
                b = visit_y > b ? visit_y : b;
            }
        }
        // Left
        if (id_x > 0 && !visited[id - 1]) {
            size_t visit_id = id - 1;
            if (visit_cell(visit_id, queue, &queue_len, visited, img)){
                size_t visit_x = visit_id % img->width;
                l = visit_x < l ? visit_x : l;
            }
        }
        //Right
        if (id_x < (img->width-1) && !visited[id + 1]){
            size_t visit_id = id + 1;
            if (visit_cell(visit_id, queue, &queue_len, visited, img)){
                size_t visit_x = visit_id % img->width;
                r = visit_x > r ? visit_x : r;
            }
        }
    }
    
    // Cut the rightmost number from the image
    Image *num_img = subimage(img, (Rect){.top=t,.left=l,.bottom=b,.right=r});
    size_t num_w = img->width - l; size_t new_w = img->width - num_w;
    for (size_t y = 1; y < (size_t)img->height; ++y){
        // Move each row to its new place in the pixel array, leaving
        // behind the cropped bytes
        memmove(&img->pixels[new_w * y], 
                &img->pixels[img->width * y], 
                sizeof(unsigned) * new_w);
    }
    img->width = new_w;

    free(queue);
    free(visited);

    return num_img; 
}



char *ocr(Image *image) {
    populate_truths();
    const size_t N_PIXELS = image->height * image->width;
    
    Rect trim_bounds = into_binary(image);
    Image *trimmed_bin = subimage(image, trim_bounds);
    char *out_str = calloc(1024, 1); size_t out_len = 0;
    while (trimmed_bin->width >= 8){
        // Grab the rightmost number
        Image *rmost_num = cut_rightmost_number(trimmed_bin);
        if (!rmost_num) { break; }
        Image *tr = trim_garbage(rmost_num);
        free_image(rmost_num);
        
        Image *ds = resized_image(tr);
        free_image(tr);
        
        // Compare against truth values for each digit
        double min_err = INFINITY; int min_err_digit = -1;
        for (int i = 0; i < 10; ++i){
            double err = matrix_distance(truth[i], ds->pixels);
            if (err <= min_err) {
                min_err = err;
                min_err_digit = i;
            }
        }
        // Take the lowest error digit and add to output
        out_str[out_len++] = '0' + min_err_digit;
        free_image(ds);
    }

    free_image(trimmed_bin);

    for (size_t i = 0; i < (out_len+1)/2; ++i){
        char tmp = out_str[out_len-i-1];
        out_str[out_len-i-1] = out_str[i];
        out_str[i] = tmp;
    }

    return out_str;
}


